import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import './css/style.css'
<link href="node_modules/materialize-css/dist/css/materialize.css" rel="stylesheet" type="text/css" media="screen"/>
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
